import { createRouter, createWebHistory } from "vue-router";
import TheEmployeeList from "@/views/employee/EmployeeList.vue";
import TheCustomerList from "@/views/employee/CustomerList.vue";

// dinh nghia cac router
const routers = [
  {
    path: "/employee",
    name: "EmployeeRouter",
    component: TheEmployeeList,
  },
  {
    path: "/customer",
    name: "CustomerRouter",
    component: TheCustomerList,
  },
];
const vuerouter = createRouter({
  history: createWebHistory(),
  routes: routers,
});
export default vuerouter;
